import React from "react";
import "./Fos.css";

const handleClick = () => {
  const segg = document.createElement("div");
  segg.innerHTML("segg");
  document.body.appendChild(segg);
};

const Fos = (props) => {
  return (
    <div onClick={handleClick} className="fos">
      {props.children}
    </div>
  );
};

export default Fos;
